    "2015-07-08T19:12:29.474847",nt"name": "global-15-x-15-minute-grids-of-the-downscaled-population-based-on-the-sres-b2-scenario-199",nt"isopen":
    true,nt"url": null,nt"notes": "The Global 15x15 Minute Grids of the Downscaled
    Population Based on the Special Report on Emissions Scenarios (SRES) B2 Scenario,
    1990 and 2025, are geospatial distributions of the downscaled population per unit
    area (population densities). These global grids were generated using the Country-level
    Population and Downscaled Projections Based on the SRES B2 Scenario, 1990-2100 dataset,
    and CIESIN's Gridded Population of World, Version 2 (GPWv2) dataset as the base
    map. The 1990 GPW was used as the base distribution and the country-level downscaled
    projections were used to replace population estimates of 1990 in GPW and 2025. The
    fractional distribution of the population at each grid cell is the same as the 1990
    GPW, sub-nationally. This dataset is produced and distributed by the Columbia University
    Center for International Earth Science Information Network (CIESIN).",nt"license_title":
